import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import { StatusBar } from 'expo-status-bar';
// import FontAwesome from '@expo/vector-icons/FontAwesome';

export default function Entrance({ navigation }) {
  return (
    <View style={styles.container}>
      <Text>This is the Entrance Page</Text>

      <TouchableOpacity
        style={styles.skipStyles}
        onPress={() => navigation.navigate('Login')}>
        <Text style={styles.skipbuttonText}>Go Next</Text>
      </TouchableOpacity>

      <StatusBar style="auto" />
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  skipStyles: {
    backgroundColor: '#fff',
    borderColor: '#008080',
    borderWidth: 2,
    paddingHorizontal: 20,
    paddingVertical: 10,
    borderRadius: 20,
    opacity: 0.9,
    height: 40,
    position: 'relative',
    margin: 30,
  },

  skipbuttonText: {
    color: '#008080',
    fontSize: 11,
    fontWeight: 'bold',
  },


});
